import React, {Component} from 'react';

class Album extends Component {

    render() {
        const {id, artistName, titleName, albumName} = this.props;
        return (
            <tr>
                <th>{id}</th>
                <th>{artistName}</th>
                <th>{titleName}</th>
                <th>{albumName}</th>
                <input type="submit" value="Voir"/>
            </tr>
        )
    }
}

export default Album;
